import './App.css';
import './MemberOverview'
import { MenuBar } from './MenuBar';
import { MemberOverview } from './MemberOverview';
import { ChakraProvider } from '@chakra-ui/react'

function App() {
  return (
    <ChakraProvider className="App">
      <header className="App-header">
        <MenuBar />
        <MemberOverview />
      </header>
    </ChakraProvider>

  );
}

export default App;
